import React from 'react';
import { NavLink } from 'react-router-dom';
import styles from './Navigation.module.scss';

const Navigation = () => (
    <ul className={styles.wrapper}>
        <li className={styles.navigationItem}>
            <NavLink
            activeClassName={navigationItemLinkActive} className={styles.navigationItemLink} to="/">Twitters</NavLink>
        </li>
        <li className={styles.navigationItem}>
            <NavLink
            activeClassName={navigationItemLinkActive} className={styles.navigationItemLink} to="/Articles">Articles</NavLink>
        </li>
        <li className={styles.navigationItem}>
            <NavLink
            activeClassName={navigationItemLinkActive} className={styles.navigationItemLink} to="/Notes">Notes</NavLink>
        </li>
    </ul>
);

export default Navigation;
